import React, { Component, Fragment } from 'react'
import { Link } from 'react-router-dom';

export default class Nav extends Component {
  render() {
    return (
      <Fragment>
        <nav className='navbar'>
          {/* <div> */}
          <ul className='navbar-start'>
            <div className='navbar-item has-text-black'><Link to={'/'}>Home</Link>

            </div>
            <li className='navbar-item has-text-black'><Link to={'/login'}>Log In</Link></li>
            <li className='navbar-item has-text-black'><Link to={'/signup'}>Sign Up</Link></li>
            <li className='navbar-item has-text-black'><Link to={'/dashboard'}>Dashboard</Link></li>
            <li className='navbar-item has-text-black'><Link to={'/browse'}>Browse</Link></li>
            <li className='navbar-item has-text-black'><Link to={'/mygoals'}>My Goals</Link></li>
            {/* <li><Link to={' /'}>Home</Link></li> */}
          </ul>
          {/* </div> */}
        </nav>



      </Fragment >
    )
  }
}
